description:
Verenigde Staten
Horror / Science-Fiction
86 minuten

goed

met John Ortiz, Steven Pasquale en Johnny Lewis

De strijd tussen de Alien en de Predator gaat verder. Dit keer vechten de twee monsters van een andere planeet het gevecht 
onverwacht uit in Colorado. De inwoners van de stad moeten zich vervolgens wapenen tegen dit geweld en tegelijkertijd ook 
proberen voor eens en voor altijd een einde aan het terreur van de buitenaardse wezens te maken.
